import React from 'react';

const style={
    zIndex:'-1',
    borderLeft:"6px solid #0688FA"
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div class="d-flex flex-grow-1 flex-row  justify-content-between col-md-4 mb-8 ">

            <p class="mb-md-0">{year} </p>
            <span style={style}></span>
            <figure className='u-icon u-icon--md m-0 p-0 h-100'>
                <img src={iconURL} alt='icon' />

            </figure>
            <p class>
                {content}
            </p>
        </div>
    )
}
